$(document).ready(function(){$("#myCarousel").on("slide.bs.carousel",function(e){var n=$(e.relatedTarget).index(),r=$(".carousel-item").length;if(n>=r-2)for(var o=3-(r-n),a=0;a<o;a++)"left"==e.direction?$(".carousel-item").eq(a).appendTo(".carousel-inner"):$(".carousel-item").eq(0).appendTo($(this).find(".carousel-inner"))})});